from typing import Dict, Any

def merge_dicts(*dicts: Dict[str, Any]) -> Dict[str, Any]:
    """
    Merge multiple dictionaries.

    Later dictionaries override earlier ones on key conflicts.
    Gracefully handles None values.

    Args:
        *dicts: Variable number of dictionaries to merge

    Returns:
        A new dictionary with all keys merged

    Raises:
        TypeError: If any argument is not a dict or None
        ValueError: If no dictionaries are provided
    """
    if not dicts:
        raise ValueError("At least one dictionary must be provided")

    result = {}

    for d in dicts:
        if d is None:
            continue

        if not isinstance(d, dict):
            raise TypeError(f"Expected dict or None, got {type(d).__name__}")

        result.update(d)

    return result


# Test cases
if __name__ == "__main__":
    # Basic merge
    assert merge_dicts({"a": 1}, {"b": 2}) == {"a": 1, "b": 2}

    # Override on conflict
    assert merge_dicts({"a": 1}, {"a": 2}) == {"a": 2}

    # Multiple dicts
    assert merge_dicts({"a": 1}, {"b": 2}, {"c": 3}) == {"a": 1, "b": 2, "c": 3}

    # None values handled gracefully
    assert merge_dicts({"a": 1}, None, {"b": 2}) == {"a": 1, "b": 2}

    # Single dict
    assert merge_dicts({"a": 1}) == {"a": 1}

    # Empty dict
    assert merge_dicts({}) == {}

    # Nested dicts (later override)
    assert merge_dicts({"a": {"x": 1}}, {"a": {"y": 2}}) == {"a": {"y": 2}}

    # Multiple None values
    assert merge_dicts(None, {"a": 1}, None, {"b": 2}, None) == {"a": 1, "b": 2}

    # Type error on non-dict
    try:
        merge_dicts({"a": 1}, "not a dict")
        assert False, "Should have raised TypeError"
    except TypeError as e:
        assert "Expected dict or None" in str(e)

    # Type error on list
    try:
        merge_dicts([1, 2, 3])
        assert False, "Should have raised TypeError"
    except TypeError as e:
        assert "Expected dict or None" in str(e)

    # ValueError on no arguments
    try:
        merge_dicts()
        assert False, "Should have raised ValueError"
    except ValueError as e:
        assert "At least one dictionary" in str(e)

    # Complex merge scenario
    d1 = {"a": 1, "b": {"x": 10}}
    d2 = {"b": 2, "c": 3}
    d3 = {"d": 4}
    assert merge_dicts(d1, d2, d3) == {"a": 1, "b": 2, "c": 3, "d": 4}

    print("All tests passed!")
